    return (
      <div >
        <p>

        { this.props.feedback.name }
        {title}
        <button style={btnStyle}> x</button>
        </p>
      </div>
    )
  }
}

//PropTypes
FeedbackItem.propTypes = {
    feedback : PropTypes.object.isRequired
}

const btnStyle ={
    background:'#ff0000',
    color:'#fff',
